import { Link } from 'react-router-dom'

export default function DesktopNavMenuButton(props) {
    const { linkName } = props

    function processLinkName() {
        if (/\s/.test(linkName)) {
            return linkName.split(" ").join()
        } else {
            return linkName
        }
    }

    return (
        <Link to={processLinkName()} className="NavLink">
            <button>
                <h2>{processLinkName}</h2>
                <img alt="Expand More" src="images/ui/expand_more.png" />
            </button>
        </Link>
    )
}
